import React from 'react';
import Header from '../pages/Header'
import Footer from '../pages/F'

// import Outlet
import { Outlet } from 'react-router-dom';
const Root = () => {
    return (
        <>
            <h1>Header</h1>
            <Header />
            <Outlet />
            <Footer />
        </>
    );
};

export default Root;
